script: |
  super -f text -I q11756.spq | sort > q11756.out

inputs:
  - name: q11756.spq
    data: |
      SELECT DISTINCT - + col2 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - ( ( + col1 ) ) / col2 + + - col0 IS NULL OR NULL IS NOT NULL;
  - name: tab1

outputs:
  - name: q11756.out
    data: |
      -59
      -68
      -96
